import React from 'react';

export default class User extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }

    componentDidMount() {
        fetch("http:localhost:8080/getUser")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        items: result.items
                    });
                },

            )
    }

    render() {
            return (
                <ul>
                    {items.map(item => (
                        <li key={item.response}>
                            {item.response}
                        </li>
                    ))}
                </ul>
            );
        }
}
